commits.content:
* {
    box-sizing: border-box;
}
body {
    margin: 0;
    padding: 0;
    background-image: url(loanbytee.jpg);
    background-size: cover;
    background-repeat:no-repeat ;
}
nav {
    display: flex;
    justify-content: space-around;
    align-items: center;
    min-height: 8vh;
    font-family: sans-serif;
    background: gray;
}
.logo {
    color: black;
    text-transform: uppercase;
    letter-spacing: 5px;
    font-size: 30px;
    margin-right: 100px;
    font-family: sans-serif ;
}
 .nav-links {
    display: flex;
    justify-content: space-around;
    width:30% ;
    gap: 20px;
 }
.nav-links a {
    color: #ffffff;
     text-decoration: none;
     letter-spacing: 2px;
     font-weight: bold;
     font-size: 17px;
}
.nav-links li :hover {
    transition: all 3s;
    background: #ffffff;
    color: blue;
}
.nav-links li {
    list-style: none;
}
.burger div {
    width: 25px;
    height: 5px;
    background-color: #ffffff;
    margin: 5px;
    margin-left: 90px;
    transition: all 0.3s ease-in;
}
.burger {
    display: none;
}
@media only screen and (max-width:550px) {
    body {
       overflow-x: hidden;
    }
   .nav-links {
       position: absolute;
       right: 0px;
       top: 6vh;
       height: 70vh;
       background: black;
       display: flex;
       gap: 10px;
       width: 50%;
       flex-direction: column;
       align-items: center;
       transform: translateX(100%);
       transition: transform 0.5s ease-in;
   }
   .nav-links li {
       opacity: 1;
   }
   .nav-links li :hover {
       transition: all 5s;
       color: red;
   }
   .burger {
       display: block;
       cursor: pointer;
   }
  .nav-active {
   transform: translateX(0%);
  }
}
